import '../Styles/Start.scss'
export default class Start extends Component {
  render() {
    return (
      <div>
            <div>
                SpeedTypr
                How to Play
            </div>
            <Link to={'/page'}>
                <button>
                    Start
                </button>
            </Link>
      </div>
    )
  }
}
